function VolumeControls() {

    return <div className = 'volume-controls'>

    <div onClick = {props.goToTime} className = 'volume-bar'>

        <div style ={{width : props.percentageWatched}} className = 'current-volume-bar'></div>

        <div onDrag = {props.goToTime} onClick = {(event) => {event.stopPropagation();}}  className = 'volumehead'></div>

    </div>


</div>;
}

export default VolumeControls;
